/**
 * @param {number[][]} nums
 * @return {number}
 */
var numberOfPoints = function(nums) {
    // Sort the cars based on their starting points.
    nums.sort((a, b) => a[0] - b[0]);

    let totalPoints = 0;
    let prevEnd = -1; // Keeps track of the end of the last car processed

    for (let i = 0; i < nums.length; i++) {
        let start = nums[i][0];
        let end = nums[i][1];

        if (start > prevEnd) {
            // If the current car starts after the last car ended, add all its points.
            totalPoints += end - start + 1;
        } else if (end > prevEnd) {
            // If the current car overlaps with the last car, only add the non-overlapping points.
            totalPoints += end - prevEnd;
        }

        // Update prevEnd to the max end point seen so far.
        prevEnd = Math.max(prevEnd, end);
    }

    return totalPoints;
};
